import React from 'react';
import { useNavigate } from 'react-router-dom';
import './../Home.css'
import Navbar from '../navbar/staffNavbar';

function Register()
{
    const userTypes = ["0", "1"];

    //Setting state/declaration
    const [fullName, setFullName] = useState('');
    const [idNumber, setIdNumber] = useState('');
    const [password, setPassword] = useState('');
    const [email, setEmail] = useState('');
    const [acountNumber, setAcountNumber] = useState('');
    const [userType, setUserType] = useState('');
    const [error, setError] = useState('');
    const [action, setAction] = useState(userTypes);
    const navigate = useNavigate();


    //Setting function to not use default get method on form
    const handleSubmit = async (e) => {
        e.preventDefault();
        setError('');

        try
        {
            // const response = await fetch('/api/auth/login', 
            // {
            //     method: 'POST',
            //     headers: {'Content-Type': 'application/json'},
            //     body: JSON.stringify({email, acountNumber, password})
            // });

            // const data = await response.json();

            // if (data.error)
            // {
            //     setError(data.error);
            // }
            // else
            // {
            //     localStorage.setItem('token', data.token);
            //     window.location.href = '/chome';
            // }

            // const response = await axios.post('/api/auth/login', {email, acountNumber, password});
            // localStorage.setItem('token', response.data.token);
            // navigate('/chome');
            //window.location.href = '/login';
        }
        catch(err)
        {
            if (err.response)
            {
                setError(err.response.data.message);
            }
            else
            {
                setError('Something went wrong. Please try again.');
            }
        }
    }


    return(
        <>
        <div className="register-container">
            <h1>{action} Login</h1>
            <br/>

            {/* Cusromers' login form */}
            <form onSubmit={handleSubmit} className="customerRegisterForm" >
                <label htmlFor='fullname'>Fullname</label><br/>
                <input type="text" id='fullname' name="fullname" value={fullName} onChange={(e) => setFullName(e.target.value)} autoComplete="true"/><br/>
                
                <label htmlFor='idNumber'>ID Number</label><br/>
                <input type="idNumber" id='idNumber' name="idNumber" value={idNumber} onChange={(e) => setIdNumber(e.target.value)}/><br/>

                <label htmlFor='accNumber'>Account Number</label><br/>
                <input type="text" id='accNumber' name="accNumber" value={acountNumber} onChange={(e) => setAcountNumber(e.target.value)} autoComplete="true"/><br/>
                
                <label htmlFor='email'>Email</label><br/>
                <input type="email" id='email' name="email" value={email} onChange={(e) => setEmail(e.target.value)}/><br/>

                <label htmlFor='password'>Username</label><br/>
                <input type="password" id='password' name="password" className="transDetails" value={password} onChange={(e) => setPassword(e.target.value)} autoComplete="true"/><br/>
                
                
                <div>
                <label htmlFor='userType'>UserType</label><br/>  
                    <select className="transDetails" value={userType} onChange={e => setUserType(e.target.value)}>
                        {statuses.map(status => <option key={userTypes} value={userTypes}>
                            {status}
                        </option>)}
                    </select>
                </div>

                {error && <p style={{color: 'red'}}> {error} </p>}

                <button type="submit">Register</button>
            </form>
        </div>
        </>
    );
}

export default Register;
